&lt;p&gt;CHARACTERISTICS:&lt;/p&gt;

&lt;p&gt;Fetal heart monitor is a tool to listen to fetal heart rate for pregnant mothers. Fetal heart monitor is used to monitor fetal heart rate from 12 weeks of age and older. Detect fetal heart sounds. Detect and monitor fetal heart rate. Determine survival after critical.&lt;/p&gt;

&lt;p&gt;Fetal heart monitor - Model: DP 6000H - Brand: Trismed - Korea with the following advantages:&lt;/p&gt;

&lt;p&gt;- 1.7&amp;quot; LCD screen with backlight&lt;br /&gt;
- High sensitivity, replaceable probe&lt;br /&gt;
- Waterproof probe type: 2.5MHz.&lt;br /&gt;
- The device can hear the fetal heart clearly and accurately because it has an automatic noise filtering system&lt;br /&gt;
- Pre-installed inside the audio speaker system&lt;/p&gt;

&lt;p&gt;- Auto-off after one minute of no signal&lt;/p&gt;

&lt;p&gt;SPECIFICATIONS:&lt;/p&gt;

&lt;p&gt;Physical characteristics&lt;/p&gt;

&lt;p&gt;Dimensions 135mm (length) x 95 mm (width) x 35 mm (height)&lt;br /&gt;
Weight Approx. 180 g (including battery)&lt;br /&gt;
Display LCD Monitor 45mm x 25mm&lt;br /&gt;
Show fetal heart rate&lt;/p&gt;

&lt;p&gt;FHR range 50 ~ 210 BPM (beats per minute)&lt;br /&gt;
Accuracy &amp;plusmn;1 BPM&lt;br /&gt;
Power Consumption &amp;lt;0.8 W&lt;br /&gt;
Power off automatically After one minute of no signal, the power will automatically turn off&lt;br /&gt;
Battery type&lt;br /&gt;
2 batteries of type 1.5 VDC (size AA LR6)&lt;/p&gt;

&lt;p&gt;Probe&lt;br /&gt;
Common frequency 2.5 MHz&lt;br /&gt;
Operating frequency 2.5 MHz &amp;plusmn; 15 %&lt;br /&gt;
Pressure &amp;lt; 0.5 Mpa&lt;br /&gt;
