&lt;p&gt;Ispta &amp;lt; 100 mW/cm&amp;sup2;&lt;br /&gt;
Isata ultrasound output intensity &amp;lt; 10 mW/cm&amp;sup2;&lt;br /&gt;
Working state Continuous wave Doppler effect&lt;br /&gt;
Affected area 208 mm&amp;sup2; &amp;plusmn; 15%&lt;/p&gt;
